import * as S from "./styled";
import { AiFillCloseCircle } from "react-icons/ai";
import Button from "../Button";
export type ToastProps = {
  message: string;
};

const Toast = ({ message }: ToastProps) => {
  return (
    <S.Wrapper>
      <S.Modal>
        <S.ContentModal>
          <p> {message} </p>
          <button>Fechar</button>
        </S.ContentModal>
      </S.Modal>
    </S.Wrapper>
  );
};

export default Toast;
